import React from 'react';

const AskForDetailsComponent = () => {
    return (
        <div>
            <button>Ask For Details</button>
            <p>This automaically sends a message to the seller.</p>
            <div></div>
            <img src={require('../../public/ic_messenger.png')}></img>
            <p>Message</p>
            <img src={require('../../public/ic_messenger.png')}></img>
            <p>Save </p>
            <img src={require('../../public/ic_messenger.png')}>Share</img>
            <p></p>
        </div>
    );
}

export default AskForDetailsComponent;
